import s from './catalog.module.css';
import BookElem from './../Elems/BookElem/bookElem.jsx';
import FilmElem from './../Elems/FilmElem/filmElem.jsx';
import UserElem from './../Elems/UserElem/userElem.jsx';

const CatalogPage = (props) =>{

  let elems = []
  switch (props.type) {
    case 'book':
      elems = props.elemsList.map((bookElem)=>{
        return (<BookElem info={bookElem}/>)
      });
      break;
    case 'film':
      elems = props.elemsList.map((filmElem)=>{
        return (<FilmElem info={filmElem}/>)
      });
      break;
    case 'user':
      elems = props.elemsList.map((userElem)=>{
        return (<FilmElem info={userElem}/>)
      });
      break;
    default:
      break;
  }

  return (
    <div className={s.catalogPage}>
      <div className={s.searchline}>
        <input type="text" />
        <button>Search</button>
      </div>
      <div className={s.elemList}>
        {elems}
      </div>
    </div>
  );
}

export default CatalogPage;
